	<style>
.cucumber-react .cucumber-status--passed {
  color: #2CB14A;
}
.cucumber-react .cucumber-status--skipped {
  color: #00A0CC;
}
.cucumber-react .cucumber-status--pending {
  color: #FFAD33;
}
.cucumber-react .cucumber-status--undefined {
  color: #FFAD33;
}
.cucumber-react .cucumber-status--ambiguous {
  color: #F4EBFD;
}
.cucumber-react .cucumber-status--failed {
  color: #BB0000;
}
.cucumber-react .cucumber-status--unknown {
  color: #B6BECB;
}
.cucumber-react h1, .cucumber-react h2, .cucumber-react h3 {
  padding: 0;
  margin: 0;
}
.cucumber-react a {
  color: inherit;
}
.cucumber-react .gherkin-document-list {
  font: 14px "Open Sans", sans-serif;
  color: #161C24;
  background: #fff;
  overflow-x: hidden;
}
.cucumber-react .cucumber-title {
  margin-top: 0.3em;
  margin-bottom: 0;
  display: inline-block;
}
.cucumber-react .cucumber-title__keyword {
  font-weight: bold;
}
.cucumber-react .cucumber-title__text {
  font-weight: normal;
}
.cucumber-react .cucumber-tags {
  padding: 0;
  margin-bottom: 0;
}
.cucumber-react .cucumber-tags .cucumber-tag {
  display: inline;
  list-style-type: none;
  padding: 4px 8px 4px 8px;
  margin-right: 6px;
  background-color: #FFFFFF;
  border-radius: 6px;
}
.cucumber-react .cucumber-feature__icon {
  padding-top: 0.35em;
  padding-right: 0.5em;
}
.cucumber-react .cucumber-description,
.cucumber-react .cucumber-children {
  margin-left: 1em;
}
.cucumber-react .cucumber-feature,
.cucumber-react .cucumber-rule,
.cucumber-react .cucumber-scenario,
.cucumber-react .cucumber-background {
  margin-bottom: 1em;
}
.cucumber-react .cucumber-steps {
  list-style-type: none;
  padding-left: 10px;
}
.cucumber-react .cucumber-steps .cucumber-step {
  display: flex;
}
.cucumber-react .cucumber-steps .cucumber-step__status {
  padding-top: 0.2em;
  padding-right: 0.5em;
}
.cucumber-react .cucumber-steps .cucumber-step__content {
  flex-grow: 1;
  max-width: calc(100% - 1.5em);
}
.cucumber-react .cucumber-steps .cucumber-step__keyword {
  font-weight: bold;
}
.cucumber-react .cucumber-steps .cucumber-step__text {
  font-weight: normal;
}
.cucumber-react .cucumber-steps .cucumber-step__param {
  font-weight: normal;
  font-style: italic;
}
.cucumber-react .cucumber-table {
  border-collapse: collapse;
  margin-top: 0.5em;
  margin-bottom: 0.5em;
}
.cucumber-react .cucumber-table__header-cell {
  border: 1px solid #4B5662;
  padding: 0.3em;
}
.cucumber-react .cucumber-table__cell {
  border: 1px solid #4B5662;
  padding: 0.3em;
}
.cucumber-react .cucumber-table__cell__status {
  padding: 0.5em 3px 3px 3px;
}
.cucumber-react .cucumber-table__cell__step {
  flex-grow: 1;
}
.cucumber-react .cucumber-code {
  padding: 0.25em;
  background-color: #ebebeb;
}
.cucumber-react .cucumber-error {
  padding: 0.5em;
  margin: 0;
  overflow-x: auto;
}
.cucumber-react .cucumber-no-documents {
  font: 14px "Open Sans", sans-serif;
}
.cucumber-react .cucumber-attachment__icon {
  margin-right: 0.5em;
}
.cucumber-react .cucumber-attachment__image {
  max-width: 100%;
  margin-top: 1em;
}
.cucumber-react .cucumber-attachment__text {
  background-color: #ebebeb;
  padding: 0.5em;
  overflow-x: auto;
}
.cucumber-react .cucumber-anchor {
  position: relative;
  display: flex;
  align-items: center;
  margin-top: 0.3em;
}
.cucumber-react .cucumber-anchor__link {
  opacity: 0;
  transition: all 0.35s ease-in-out;
  position: absolute;
  left: -20px;
  display: flex;
  align-items: center;
}
.cucumber-react .cucumber-anchor__icon {
  margin-right: 0.5em;
}
.cucumber-react .cucumber-anchor:hover a {
  opacity: 1;
  width: max-content;
  transition: all 0.35s ease-in-out;
}
.cucumber-react .cucumber-anchor > * {
  height: 100%;
  margin-top: 0px;
}

.cucumber-report-header {
  width: 100%;
  display: grid;
  grid-template-columns: 1fr;
  border: 1px solid rgba(0, 0, 0, 0.1);
  font: 11px "Open Sans", sans-serif;
  margin-bottom: 1em;
}
.cucumber-report-header > * {
  padding: 1em;
}
.cucumber-report-header .cucumber-status-filter {
  border-bottom: 1px solid rgba(0, 0, 0, 0.1);
}
.cucumber-report-header .cucumber-status-filter table {
  width: 100%;
}
.cucumber-report-header .cucumber-execution-data {
  border-bottom: 1px solid rgba(0, 0, 0, 0.1);
}
.cucumber-report-header .cucumber-search-bar {
  border-right: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search {
  width: 100%;
  display: grid;
  grid-template-columns: 9fr 1fr;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search input {
  padding: 0.4em;
  border-radius: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search button {
  height: 2.2em;
  padding-left: 0.6em;
  padding-right: 0.6em;
}
.cucumber-report-header .cucumber-search-bar p.help {
  font-size: 80%;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul {
  display: inline;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li {
  list-style-type: none;
  display: inline-block;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li input {
  display: inline-block;
  width: auto;
  height: 0.6em;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li label {
  padding-right: 1em;
}

@media only screen and (min-width: 600px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: 1/-1;
  }
}
@media only screen and (min-width: 992px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr 2fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-execution-data {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: auto;
  }
}
.accordion {
    border: 1px solid rgba(0, 0, 0, 0.1);
    border-radius: 2px;
}

.accordion__item + .accordion__item {
    border-top: 1px solid rgba(0, 0, 0, 0.1);
}

.accordion__button {
    background-color: #f4f4f4;
    color: #444;
    cursor: pointer;
    padding: 10px;
    width: 100%;
    text-align: left;
    border: none;
}

.accordion__button:hover {
    background-color: #ddd;
}

.accordion__button:before {
    display: inline-block;
    content: '';
    height: 10px;
    width: 10px;
    margin-right: 12px;
    border-bottom: 2px solid currentColor;
    border-right: 2px solid currentColor;
    transform: rotate(-45deg);
}

.accordion__button[aria-expanded='true']::before,
.accordion__button[aria-selected='true']::before {
    transform: rotate(45deg);
}

.accordion__panel {
    padding: 20px;
    animation: fadein 0.35s ease-in;
}

  | facebook             | https://www.facebook.com/ |\n      | twitter              | twitter              | https://twitter.com/      |\n      | google-plus          | google-plus          | https://www.google.com/   |\n      | linkedin             | linkedin             | https://www.linkedin.com/ |\n#----------------------------------------------------------------------\n\n  @ADVSYS-4\n  Scenario: Verify title of Home Page\n    Then Verify title of Home page is \"Advance Systems - Home\"\n#----------------------------------------------------------------------\n\n  @ADVSYS-6\n  Scenario: Verify address and phone number are displayed\n    Then Verify address is \"10090 Main Street\"\n    And Verify city, state and country is \"Fairfax, VA, USA\"\n    And Verify phone number is \"+1 234 567 1234 \"\n#---------------------------------------------------------------------------\n\n  @ADVSYS-13\n  Scenario: Verify header and testimonials by peoples\n    Given Verify the header texts\n    Then Verify the testimonials\n    Then Verify the name of clients\n    And Verify the states\n    #Add ScreenShot in jenkins to prove the location on header, testimonials, name and state.\n#------------------------------------------------------------------------------\n\n  @ADVSYS-10a\n  Scenario: Parallax section content information and update\n    When Information is displayed in the parallax section\n    Then Header and description update automatically\n\n  @ADVSYS-10b\n  Scenario: Parallax section button\n    When User clicks on \"Read More\" button in parallax section\n    Then User should see the \"Services\" page displayed\n#----------------------------------------------------------------------------------\n\n  @ADVSYS-14\n  Scenario: Verify user can see company names above footer\n    Then Verify user sees company image\n#---------------------------------------------------------------------------------\n\n  @ADVSYS-11\n  Scenario: Verify home page has a header,secondary header, and description text\n    Then Verify header is \"Welcome to Advance Systems LLC.\"\n    And Verify secondary header is \"Our Mission is simple, deliver very honest recruitment services to every customer.\"\n    And Verify description text is \"Day in and day out for the last years we’ve been more than just a staffing company. Throughout this time we’ve built relationships, we’ve grown together internally and externally, and have created a system that allows us to personally cater to the needs of our clients and candidates. We’ve been a mentor for some, a team builder for others, but most importantly we’ve been there. We know there is no substitute for experience, so let us help you navigate through the ever changing web of talent. \"\n#-----------------------------------------------------------------------------------\n\n  @ADVSYS-12\n  Scenario Outline: Verify expect sections are displayed as a header\n    Then Verify \"\u003cexpect\u003e\" sections is displayed as a header\n    Examples:\n      | expect                     |\n      | Leadership Development     |\n      | Capability Building        |\n      | Rewards \u0026 Benefits         |\n      | Excellent Customer Service |\n\n  @ADVSYS-12\n  Scenario: Verify Employee \u0026 Employer Relations is displayed as a header\n    Then Verify Employee \u0026 Employer Relations is displayed\n\n  @ADVSYS-12\n  Scenario: Verify descriptions under expect sections is displayed\n    Then Verify descriptions under expect sections is displayed\n#---------------------------------------------------------------------------------\n\n  @ADVSYS-20\n  Scenario: Verify Copyright text is updated\n    Then Verify copyright text is \"Copyright © 2022 Advance Systems LLC. All Rights Reserved.\"\n#---------------------------------------------------------------------------------\n\n  @ADVSYS-19\n  Scenario: There should be a button in the bottom right corner of the page that would scroll the window to top content once clicked.\n    Given scroll down to bottom of the page\n    Then Click on button go back button when scroll down to bottom of the page\n    And Check if it back to top content\n#---------------------------------------------------------------------------------\n\n  @ADVSYS-20\n  Scenario: Verify Copyright text is updated\n    Then Verify copyright text is \"Copyright © 2022 Advance Systems LLC. All Rights Reserved.\"\n#---------------------------------------------------------------------------------\n\n  @ADVSYS-15\n  Scenario Outline: following information should be displayed in footer section\n    Then Verify \"\u003ccontact\u003e\" information is displayed\n    Examples:\n      | contact                             |\n      | Address: 10090 Main St, Fairfax, VA |\n      | Phone: +1 703-831-321               |\n      | Email: info@advancesystems.us       |\n      | Mon to Sat: 9.00 am to 5:00 pm      |\n#---------------------------------------------------------------------------------\n\n  @ADVSYS-17\n  Scenario Outline: Footer social media buttons displayed\n    Then Verify \"\u003cfooter sm options\u003e\" icon is displayed\n    When User click on \"\u003cfooter sm buttons\u003e\"\n    Then User is navigated to new tab\n    Then Verify URL contains \"\u003cfooter sm url\u003e\"\n    Examples:\n      | footer sm options | footer sm buttons | footer sm url |\n      | facebook          | facebook          | facebook      |\n      | twitter           | twitter           | twitter       |\n      | skype             | skype             | skype         |\n      | linkedin          | linkedin          | linkedin      |\n\n#---------------------------------------------------------------------------------\n  @ADVSYS-16 @smoke\n  Scenario Outline: Footer essential quick links displayed and working as expected\n    Given scroll down to bottom of the page\n    When User click on \"\u003cquick link\u003e\" link\n    Then Verify page title contains \"\u003ctitle\u003e\"\n    Then Verify URL contains \"\u003curl\u003e\"\n    Examples:\n      | quick link | title      | url       |\n      | Home       | Home       | index     |\n      | About Us   | About Us   | about     |\n      | Services   | Services   | services  |\n      | Clients    | Clients    | clients   |\n      | Solutions  | Solutions  | solutions |\n      | Contact Us | Contact Us | contact   |\n\n  @ADVSYS-18\n  Scenario: Verify section should have email input field\n    Then Verify email input field has placeholder \"Email Address...\"\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/pariya/Desktop/advance-systems-LiveProject/src/test/resources/features/home.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@homeScenarios","id":"40e4bf8b-910c-418c-8d03-47f878ec38a4"}],"language":"en","keyword":"Feature","name":"Homepage related scenarios","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[{"location":{"line":4,"column":3},"name":"@ADVSYS-7","id":"34c063da-bd67-4c55-b5fd-b1438aaaac06"}],"keyword":"Scenario","name":"Verify \"Join Now\" button is displayed","steps":[{"location":{"line":6,"column":5},"keyword":"Then ","text":"Verify \"Join Now\" button is displayed","id":"0fc59e58-ebff-4a4c-be11-18aebdf464a7"}],"id":"58037f60-2bb3-4cc4-accd-301a680525b6"}},{"scenario":{"location":{"line":9,"column":3},"tags":[{"location":{"line":8,"column":3},"name":"@ADVSYS-7","id":"0dd4adc1-7828-438f-9c74-34d0db8a1769"}],"keyword":"Scenario","name":"Verify title of Join Us Page","steps":[{"location":{"line":10,"column":5},"keyword":"When ","text":"user click on \"Join Now\" button","id":"87b6b956-1aaa-4f22-8577-0e0545be43d2"},{"location":{"line":11,"column":5},"keyword":"Then ","text":"Verify title of page is \"Advance Systems - Join\"","id":"3a537a01-06dc-40de-b2d5-12c032609848"}],"id":"0bd9c8ad-e8e4-4f01-9ee6-a0d2cedc4cc6"}},{"scenario":{"location":{"line":15,"column":3},"tags":[{"location":{"line":14,"
